import {
  BrowserRouter as Router,
  Routes,
  Route,
} from "react-router-dom";
import HomePage from "./pages/HomePage/HomePage";
import MatchPage from "./pages/MatchPage/MatchPage";
import Tournament from "./pages/Tournament/Tournament";
import Tournament_id from "./pages/Tournament_id/Tournament_id";
import WebPage from "./pages/WebPage/WebPage";


function App() {
  return (

  <Router>
    {/* <link rel="stylesheet" href="https://fonts.googleapis.com/css?family=Audiowide"></link> */}
    <link rel="preconnect" href="https://fonts.googleapis.com"/>
    <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin/>
    <link href="https://fonts.googleapis.com/css2?family=Roboto+Slab:wght@100;200;300;400;500;600;700;800&family=Rokkitt:ital,wght@0,100;0,200;0,300;0,400;0,500;0,600;0,700;0,800;1,100;1,200;1,300;1,400;1,500;1,600;1,700;1,800&display=swap" rel="stylesheet"></link>
    <link href="https://fonts.googleapis.com/css2?family=Lato:ital,wght@0,100;0,300;0,400;0,700;0,900;1,100;1,300;1,400;1,700;1,900&family=Open+Sans:ital,wght@0,300;0,400;0,500;0,600;0,700;0,800;1,300;1,400;1,500;1,600;1,700;1,800&display=swap" rel="stylesheet"></link>
    <Routes>
      <Route path="/" element={<WebPage page={<HomePage/>}/>} />
      <Route path="/tournament" element={<Tournament/>} />
      <Route path="/tournament/:id" element={<Tournament_id/>} />

      <Route path="/match/:m_id" element={<WebPage page={<MatchPage/>}/>}  />
      <Route path="/match/:m_id/:inn_no/:graphic" element={<WebPage page={<MatchPage/>}/>}  />
    </Routes>
  </Router>
  );
}

export default App;
